import {getAllClinics} from "./Clinics Functions/ClinicsFunctions";
import ClinicCard from "./ClinicCard";

const ClinicsTable = () => {

    const [clinics, setClinics] = useState([]);

    const [loading, setLoading] = useState(true)

    useLayoutEffect(() => {
   getAllClinics(setClinics).then(()=>{
       setLoading(false)
   })
    }, [])


    // useLayoutEffect(() => {
